import axios from  'axios';
import ValidationError from "../flashError";

function Convo(){




    useEffect(()=>{
        axios.get('/api/convo', {withCredentials : true})
        .then(res =>{
            console.log(res)
        })
        .catch((err) =>{
            console.log(err)
        })
    }, [])

    return(
        <div>
            <h1>Hello this is MessageHub</h1>
            <form action="/convo?username=" method="GET" autocomplete="off">
                <label for="searchContact"></label>
                <input id="searchContact" name='username' />
                <button>Search</button>
            </form>
        </div>
    )
}

export default Convo;
